void getWebAngles(uint8_t lane, int8_t web){
	int8_t xo, yo;  // Offset
	int8_t xm, ym;  // Middle of lane end
	int8_t xs, ys;  // Middle of lane start
	int8_t xg, yg;  // gradient of lane
	uint8_t i;
	uint8_t laneLower;

	laneLower = lane>>2;				// Get the camera angle (0..64)

	xo = pgm_read_byte(&webOffsets[web].offset[laneLower].x);    // Get the X/Y offset for this camera angle.
	yo = pgm_read_byte(&webOffsets[web].offset[laneLower].y);

	for (i=0;i<16;i++){						// for each of the 16 lanes

		xm = pgm_read_byte(&laneMiddles[web].lane[i].x);  	// get the middle pixel of the outside of the lane
		ym = pgm_read_byte(&laneMiddles[web].lane[i].y);

		xm = xm - xo;						// subtract the camera angle offset from it
		ym = ym - yo;

		xs = xm / 4;						// get the start of the lane by dividing the end of the lane by 4
		ys = ym / 4;

		xm = xm + 128;						// center adjust the signed int to the unsigned X/Y pixel values
		ym = ym + 120;
		xs = xs + 128;
		ys = ys + 120;

		xg = xm - xs;						// get the gradient from the xStart to the xEnd
		yg = ym - ys;

		laneData[i].xStart = xs;			// write these values to the RAM table used by "move object"
		laneData[i].yStart = ys;
		laneData[i].xGrad = xg;
		laneData[i].yGrad = yg;
		//laneData[i].highestEnemy = 0;
	}
}
